// TopNav.jsx
import React from 'react';

const TopNav = () => {
  return (
    <div className="flex items-center justify-between bg-[#232f3e] text-white px-6 py-3">
      {/* Left Side: Menu and Sidebar */}
      <div className="flex items-center gap-6">
        <div className="text-white font-bold text-lg">Menu</div>

        {/* Sidebar Menu here if collapsible */}
        <div className="flex items-center space-x-6 text-sm text-white/80">
          <span className="hover:underline cursor-pointer">Orders</span>
          <span className="hover:underline cursor-pointer">Items</span>
          <span className="hover:underline cursor-pointer">Merchandising</span>
          <span className="hover:underline cursor-pointer">Growth</span>
          <span className="hover:underline cursor-pointer">Reports</span>
          <span className="hover:underline cursor-pointer">Learn</span>
        </div>
      </div>

      {/* Right Side: Logo */}
      <div className="font-semibold text-lg">amazon vendor central</div>
    </div>
  );
};

export default TopNav;
